import React, {useState} from 'react';

import { StyleSheet, Text, View, FlatList, Image, TouchableOpacity } from 'react-native';

const styles = StyleSheet.create({
  images: {
  	alignSelf: 'stretch',
   resizeMode: 'contain',
  }
});


function KatsItem ({item, navigation, id}) {


	return (
	<View style={{
			flexDirection: 'row',
			height: 'auto',
	        justifyContent: 'center',
	        alignItems: 'center',
	        padding: 15,
	        borderWidth: 1,
	      }}
	      >
	      <TouchableOpacity onPress={() => {
	      	navigation.navigate('kats view', {
	      		itemId: item.id
	      	})
	      }}>
			<Image
			style={styles.images}
          	source={{
            width: 150,
            height: 260,
            uri: item.preview
        }}
          />
          </TouchableOpacity>
          <View>
	          <Text style={{fontSize: 40, padding: 25}}>
	          {item.cat}	
	          </Text>
	      </View>	         
		</View>
	)
}

export default KatsItem;
